import React from 'react';

class OpenSeaApi extends React.Component {
  componentDidMount() {
    fetch('https://api.opensea.io/api/v1/assets?asset_contract_address=0xf87e31492faf9a91b02ee0deaad50d51d56d5d4d&on_sale=true&limit=2')
    .then(results => {
      return results.json();
    }).then(data => {
      let pictures = data.results.map((pic) => {
        return (
        <div key={pic.results}>
          <img src={pic.asset_contract.image_url} />
        </div>
        )
      })
      this.setState({pictures: pictures});
      console.log("state", this.state.pictures);
    })
  }

  render() {
    return (
      <div className="container2">
        <div className="container1">
          {this.state.pictures}

        </div>

      </div>
    )
  }

}
